import { Link } from "react-router-dom";
import GymBag1 from "../GymBagImages/GymBag1.jpg";
import CasualBag1 from "../CasualBagImages/CasualBag1.jpg";
import yutk_bag1 from "../DayPackImages/yutk_bag1.JPG";
import FannyPack1 from "../FannyPackImages/FannyPack1.jpg";
import Button from "react-bootstrap/Button";

function AllBags() {
  return (
    <div>
      <div className="img-fluid2">
        <img src={GymBag1} alt="banner" className="img-fluid3" />
        <div className="backdrop2"></div>
        <div className="text1">
          <p>Gym Bag</p>
          <Button
            className="container2-button"
            variant="light"
            onClick={() => <Link to="/allkits"></Link>}
          >
            Shop Now
          </Button>
        </div>
      </div>
      <div className="img-fluid2">
        <img src={CasualBag1} alt="banner" className="img-fluid3" />
        <div className="backdrop2"></div>
        <div className="text1">
          <p>Casual Bag</p>
          <Button
            className="container2-button"
            variant="light"
            onClick={() =>
              (window.location.href =
                "https://www.amazon.in/YUTK-Badminton-Squash-Shoulder-5racquet/dp/B0BTP2RRWR/ref=sr_1_5?keywords=yutk+badminton+kit+bag&qid=1681422500&sr=8-5")
            }
          >
            Shop Now
          </Button>
        </div>
      </div>
    </div>
  );
}

export default AllBags;
